"use strict";function notySuccess(a,b){noty(a,"success",b)}function notyError(a,b){noty(a,"error",b)}function notyWarning(a,b){noty(a,"warning",b)}function noty(c,a,d){var b=new Noty({text:c,type:a,layout:"topRight",theme:"relax",timeout:"5000",killer:d});b.show()}function showErrors(a){var b=a.errors;Object.keys(b).forEach(function(c){var d=b[c];if(d.hasOwnProperty("message")){notyError(d.message)}if(d.hasOwnProperty("developer_message")){console.log(d.developer_message)}})};